import React from 'react';
import { Link } from 'react-router-dom';

let Veridict = props => {
  return (
    <div>
      <h1 className="display-6 text-center">Final Result</h1>
      <p className="lead">
       Right answers: {props.rightAnswers}
      </p>
      <p className="lead">
       Wrong answers: {props.wrongAnswers}
      </p>
      <p className="lead">
       Your result: {props.finalResult} %
      </p>
      <p className="lead">
       {props.veridict}
      </p>
      <Link to="/" className="navbar-brand text-white">
        <i className="fas fa-quiz" /> Restart Quiz
      </Link>
    </div>
  );
};

export default Veridict;
